import React from "react";
import Button from "../../components/shared/Button/Button";

const Room = () => {
  function GoBack() {
    history.push("/rooms");
  }
  return (
    <div>
      This is our single room
      <Button onClick={GoBack} text="Go Back" />
    </div>
  );
};

export default Room;
